import "./Lawyers.scss";
export const Lawyers = () => {
  return (
    <div className="lawyers">
      <div className="wrapWide">
        <div className="lawyerTitle">
          <h2>{"Onze Advocaten"}</h2>
        </div>
        <div className="lawyerSubTitle">
          {" "}
          {`Onze Advocaten
Ons team bestaat uit de advocaten Marcel van den Ende, Jack Leeman en Hein Kernkamp; in hun praktijkvoering worden zij ondersteund door officemanager Jacqueline Blok.`}
        </div>
      </div>
    </div>
  );
};
